import './App.css';
import Header from'./View/Components/Header';
import Footer from './View/Components/Footer';

import MainPage from './View/Pages/MainPage';


function App() {
  return (
    <div className="App">
      <header className="App-header">
      <Header/>
      </header>
      <div className="body-content">
          <div className="container">
            <p>hello</p>
                <MainPage />
           </div>
      </div>

      <footer>
        <Footer/>
      </footer>
    </div>
  );
}
//test
export default App;
